import React from 'react';
import ReactDOM from 'react-dom';
const App = () => {
    fetch('https://strangers-things.herokuapp.com/api/COHORT-NAME/posts')
  .then(response => response.json())
  .then(result => {
    console.log(result);
  })
  .catch(console.error);
  return <div>
    Hello World
  </div>
}
ReactDOM.render(
  <App />,
  document.getElementById('app'),
);
